  const style = {
    textDecoration:'none',
    marginRight: 10,
    fontSize:25,
    color: 'black'
  };

  return (
    <div>
        <Box component="section" sx={{ p: 3,marginBottom: '20px', border: '1px dashed grey',}}>

        </Box>
    </div>
  )
}
const Layout = () =>{
  return(
    <div>
      <Link to="/" style={style}>Home</Link>
      <Link to="/blogs" style={style}>Blogs</Link>
      <Link to="/about" style={style}>About</Link>
    </div>
  )
};
export default Top
